var $bm_rt;
var amp, freq, decay, n, n, t, t, t, v, w;
amp = 1;
freq = 5;
decay = 8;
$bm_rt = n = 0;
if (numKeys > 0) {
    $bm_rt = n = nearestKey(time).index;
    if (key(n).time > time)
        n--;
}
if (n == 0) {
    $bm_rt = t = 0;
} else {
    $bm_rt = t = $bm_sub(time, key(n).time);
}
if (n > 0 && t < 1) {
    t = $bm_sub(time, key(n).time);
    v = velocityAtTime($bm_sub(key(n).time, $bm_div(thisComp.frameDuration, 10)));
    w = $bm_mul($bm_mul(freq, Math.PI), 2);
    $bm_rt = $bm_sum(value, $bm_div($bm_mul($bm_mul(amp, $bm_div(v, w)), Math.sin($bm_mul(t, w))), Math.exp($bm_mul(decay, t))));
} else
    $bm_rt = value;
